package com.dbyl.example;

import com.dbyl.libarary.utils.BasePage;

public class StringsExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String[] strings1 = {"1","2","3","4"};
		String[][] strings2 = {{"1","2","3"},{"4","5","6","7"},{"8","9"}};
		System.out.print(strings1[0]);
		System.out.print(strings1[1]);
		System.out.print(strings1[2]);
		System.out.print(strings1[3]);
		System.out.print(strings2[0][0]);//第一组第一个元素
		System.out.print(strings2[1][2]);//第二组第六个元素
		
	}

}
